import React, {useState} from 'react';
import ItemImage from '../Images/ItemImage.svg'
import '../Styles/productCard.css';



function CustomerListOfProduts (props) {

    const [name, setName] = useState(props.productName);
    const [imageProduct, setImageProduct] = useState(props.productImage);
    const [price, setPrice] = useState(props.productPrice);

    return(
        <li id="product">
            <div className="blockItem">
                <img src={imageProduct} className="ImgItem" alt="ImgItem"/>
                <p className="ItemName">{name}</p>
                <p className="ItemPrice">$ {price}</p>
                <button className="btnItem">ADD</button>
            </div>
        </li>
    );
}

export default CustomerListOfProduts;
